      content:
        "Situated on a cliff overlooking the Mediterranean Sea, on the outskirts of the fishermen village of Villajoyosa, this hotel offers exceptional surroundings between the sea, beaches, well kept gardens and hills. It is 3 km from the centre of Villajoyosa where a wide variety of shops, opportunities for leisure activities and entertainment facilities can be found. Benidorm is 15 km away.\n\nThis splendid and romantic beach hotel, a great choice for adults and couples, has a total of 85 rooms, including 47 double rooms, 9 junior suites, 2 suites and 4 bungalows, as well as wonderful Arab gardens. At the 24-hour reception desk there is currency exchange service, safe box, cloakroom and schedule information among many other services. Guests have the opportunity to enjoy the lounges, including the bar-lounge Alhambra with re-creation of constellations at night. The establishment offers 2 restaurants, the Minarete, situated next to the beach, where the best fresh products from the Mediterranean can be enjoyed and the 'Emperador', an elegant restaurant with fine cuisine. The hotel also has panoramic lifts accessing the beach, Internet access (local charge) and a private car park (local charge and subject to availability). The hotel admits pets (with supplement). The hotel offers laundry and ironing service (local charge) and room service.\n\nWith an elegant and functional decoration, the spacious and comfortable rooms have air conditioning and heating, telephone, digital interactive television (Quadriga) with pay-per-view with premiere and classic movies, Internet connection (local charge), minibar, safe box and music. Furthermore, each is equipped with a bathroom with hairdryer and a terrace overlooking the sea. There are also bungalows with fireplaces, suites and a presidential suite.",
